INSERT INTO `abouts` (`id`, `about`) VALUES
(1, '<div style="text-align: center;"><h2 class="title" style="text-align: center; font-family: &quot;Josefin Sans&quot;, sans-serif; font-weight: 600; color: rgb(5, 7, 9); margin-top: 0px; margin-bottom: 30px; font-size: 1.71429em;">UDAIPUR CHAMBER OF COMMERCE &amp; INDUSTRY</h2><div><p style="margin-bottom: 20px; line-height: 1.85714em; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; text-align: justify; font-size: 16px;">The Udaipur Chamber of Commerce &amp; Industry (UCCI), a multi district apex body of trade, industry, mining &amp; tourism and partnering industry and government alike through advisory and consultative processes, works to create and sustain an environment conducive to the growth of industry in Southern Rajasthan.</p><p style="margin-bottom: 20px; line-height: 1.85714em; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; text-align: justify; font-size: 16px;">UCCI is a non-government, not-for-profit industry-led and industry-managed organization, playing a proactive role in Rajasthan’s development process. Founded over 47 years ago, it is Southern Rajasthan’s premier business association, with a solid membership of over 400 industries/entrepreneurs from the private as well as public sectors. UCCI is accredited with ISO 9001: 2008 certificate, ISO 14001: 2004 and ISO 18001: 2008 certifications for Integrated Management Systems and OHSAS.</p></div></div>');
