(2, 'Test Blog 1', '<span style="color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;">Publish your passions your way</span>', 'img/blog/2/599190df4eb62.jpg', '2017-09-16 10:25:04', 586, '2017-08-14 12:00:31', 586, 'draft', '0000-00-00 00:00:00', 0),
(3, 'Udaipur on its Way to Becoming a Smart City', '<p class="MsoNormal">The proud citizens of\r\nMewar received exciting news a couple of years back when the lake city found\r\nits place in the exclusive list of smart city projects across the country.\r\nWhile the project has been slow to pick up, we are now beginning to see some\r\nactivities around the lofty goals. Through the past year, we’ve been reading in\r\nthe newspapers about the smart city project being planned and a company being\r\nset up to oversee the project. Surely, it is a dream initiative and many more\r\nyears will go by before we start reaping the benefits of true development.\r\nChange will be slow. More than ever, the city needs to come together and make\r\nthe dream possible. <o:p></o:p></p>\r\n\r\n<p class="MsoNormal">What comes to your\r\nmind when you hear “Smart City”? Futuristic, clean and loaded with all the\r\namenities of a metropolitan city perhaps. However, a smart city has to be so\r\nmuch more. The key-word behind the foundation of a Smart City is\r\n‘Sustainability’. You must have heard this word thrown around often but what\r\ndoes it really mean in the context of Smart Cities? Well, it has to do with the\r\neconomics of the city itself. Big cities like Delhi, Mumbai and Kolkata have massive\r\ninfrastructures. A large population constantly moves in and out of these cities\r\nin search of opportunities. Despite the tremendous pressure on the facilities\r\nof these cities, they seem to accommodate everyone. This comes at a huge cost.\r\nAlthough the mega-cities tend to manage the burden on its infrastructure, they\r\nhave a very poor environmental track record. Maintaining the facilities of\r\nthese mega-cities requires huge amount of energy and it drains the resources of\r\nmany nearby localities. The waste generation is usually high and disposalof waste\r\nis a mounting problem. Besides, the citizens of big towns increasingly suffer\r\nfrom lifestyle disorders and are prone to stress related health problems. So is\r\nit sustainable? Probably not.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">A smart city is supposed\r\nto bypass these issues while the urban infrastructure grows. Making the urban\r\ninfrastructure efficient and sustainable in the long term is the understated\r\npurpose behind the whole planning and re-structuring. Is it even possible?\r\nWell, that’s hard to tell. Most smart city projects around the world begin with\r\nmuch fanfare but are not able to capture the full spectrum of sustained growth.\r\nEven the company IBM which can be credited with pioneering some of the main\r\nconcepts behind Smart Cities, hasn’t been investing in the idea anymore. I\r\nthink that at some point human nature becomes the biggest deterrent in\r\nimplementing such comprehensive projects. As individuals,we are just not\r\nequipped to handle all the aspects of civic and social change simultaneously. <o:p></o:p></p>\r\n\r\n<p class="MsoNormal">Smart City projects often\r\nend up focusing on things that are just not important. To avoid this from\r\nhappening, the citizens have to be involved. People of Udaipur need to\r\nparticipate actively towards the identification of the real issues and work\r\ntogether to find solutions. No government, foreign aid or think tank can bring\r\nchange if the people of the city are not willing to better their surroundings. Somewhere\r\ndown the line, we have to stop thinking selfishly. Smart Cities initiative is a\r\ngolden chance for Udaipur to turn towards modernization and we should try to\r\nbring all its communities and resources together to build a sustainable eco-system.\r\nWe don’t want Udaipur to become Mumbai or Delhi. We just want Udaipur to become\r\na better Ud<a name="_GoBack"></a>aipur.<o:p></o:p></p>', 'img/blog/3/59bcf93dc54a9.jpg', '2017-09-16 00:00:00', 586, '2017-09-16 09:45:20', 586, 'published', '2017-09-16 00:00:00', 586),
(4, 'Udaipur City Partnership Meet (IHUWASH)', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="EN-IN" style="font-family:" cambria","serif";mso-ascii-theme-font:major-latin;="" mso-hansi-theme-font:major-latin;color:black;mso-themecolor:text1"="">UCCI office bearers attended the meeting held at Nagar Nigam, Townhall today by<a name="_GoBack"></a> the&nbsp;</span>Innovation\r\nHub for Urban Water, Sanitation and Hygiene Solutions (IHUWASH) for exploring\r\nthe possible synergies between industry and various other stakeholders to\r\ndevelop smart city infrastructure through innovative technologies and\r\nsolutions.</p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="EN-IN" style="font-family:" cambria","serif";mso-ascii-theme-font:major-latin;="" mso-hansi-theme-font:major-latin;color:black;mso-themecolor:text1"="">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="EN-IN" style="font-family:" cambria","serif";mso-ascii-theme-font:major-latin;="" mso-hansi-theme-font:major-latin;color:black;mso-themecolor:text1"="">The meeting\r\nwas conducted by the representatives of National Institute of Urban Affairs\r\n(NIUA) and TARU. It was chaired by Hon. Mayor, Shri Chandra Singh Kothari and\r\nCommissioner of Udaipur Municipal Corporation Mr.Siddharth Sihag.The UCCI\r\ndelegation included Shri Hansraj Choudhary, President, Shri Ashish Chhabra, Sr.\r\nVice President and Smt Haseena Chakkiwala, Chairman of Smart City Sub-Committee.\r\nBesides Udaipur Chamber Of Commerce and Industry, the meeting was attended by\r\nrepresentatives from prominent educational institutions and non-governmental\r\norganizations in Udaipur.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt"><span lang="EN-IN" style="font-family:" cambria","serif";mso-ascii-theme-font:major-latin;="" mso-hansi-theme-font:major-latin;color:black;mso-themecolor:text1"="">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-family:" cambria","serif";="" mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;color:black;="" mso-themecolor:text1"="">In his address Shri Chandra Singh Kothari mentioned the\r\nimportance of this initiative by highlighting the fact that Udaipur has been\r\nchosen as one of 3 cities in entire country where such a project will be\r\nimplemented. He also emphasised upon the adaptation of technology as per the\r\nlocal needs and issues. He stated that since the geographical factors are\r\ndifferent in Udaipur, we must make sure that whatever solution we implement,\r\nworks effectively in our climatic and environmental conditions.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-family:" cambria","serif";="" mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;color:black;="" mso-themecolor:text1"="">Mr.SiddharthSihag addressed the meeting by informing the\r\nattendees of the activities by IHUWASH team so far. He gave an idea on how the\r\nproject team identified the issues by surveys and created a roadmap of intervention.\r\nHe also said that he finds that today people are much more receptive to issues\r\nrelated to sanitation than before and it is a right time to work in this\r\ndirection. Talking about the involvement of funding agencies in the project, he\r\nshowed hope that the stakeholders present in the meeting will find ways to come\r\ntogether in implementing the best practices in waste management. Following the\r\naddress, IHUWASH team gave a presentation on the proposed project.Mr. Manu\r\nPrakash, CEO of TARU, gave a formal perspective on the style of collaboration\r\nand the outcomes that are expected out of this exercise. <o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-family:" cambria","serif";="" mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;color:black;="" mso-themecolor:text1"="">In his address, Shri Hansraj Choudhary expressed the\r\nimportance of following guidelines and priorities in any project\r\nimplementation. He also suggested a methodology to consolidate all different\r\naspects of smart city projects and work on them in synchronized manner.&nbsp; Shri Choudhary also presented ideas on\r\nbuilding IT based tracking mechanism for waste disposal system on the lines of\r\nControl Rooms in Railways. He put forward some queries regarding the monitoring\r\nof IHUWASH project. Opening up to the role of UCCI in the project, he stated\r\nthat UCCI can provide the best in training and awareness campaigns.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-family:" cambria","serif";="" mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;color:black;="" mso-themecolor:text1"="">The meeting then proceeded to an open house session where\r\nSmt. Haseena Chakkiwala added her insights on the behavioural aspects of\r\nsanitation industry and the social stigma attached to the staff involved in\r\ncleaning and disposal. She suggested an awareness program for schools to begin\r\na cultural change. She also stated that these projects should begin by keeping\r\n40-50 years of growth in mind. Shri Ashish Chhabra opined that firstly, there\r\nshould be a focus on water conservation since the wastage of water is the\r\nbiggest concern today. Secondly, he brought focus on the sustainability of the\r\ninitiatives for a longer period. He also gave stress on finding a way to\r\ninvolve young generation and start-ups into the project. The session continued\r\nwith other participants expressing their thoughts on water and sanitation. The\r\nmeeting concluded with a Q&amp;A session with IHUWASH team and a vote of thanks\r\nfrom the Mayor.&nbsp;</span></p>', 'img/blog/4/59bcf870696c3.jpg', '2017-09-16 00:00:00', 586, '2017-09-16 10:09:52', 586, 'published', '2017-09-16 00:00:00', 586),
(5, 'Rajasthan - The best resource for Marble in India', 'The occurrences of marble have been reportedfrom many states, viz, Rajasthan, Gujarat, Haryana,<div>&nbsp;Andhra Pradesh, Madhya Pradesh, Jammu &amp; Kashmir, Maharashtra, Sikkim, Uttar Pradesh and West Bengal.</div><div>&nbsp;Among the above states, marble deposits of economic importance are localized in Rajasthan, Gujarat, Haryana,</div><div>&nbsp;Andhra Pradesh and also in Madhya Pradesh as per the recent reports.</div><div>&nbsp;Rajasthan has the distinction of having the best among Indian resources of good quality marble. Out of 32 districts, 20&nbsp;</div><div>districts have marble in one or the other form. The important regions of marble occurrences in Rajasthan are:</div><div>&nbsp;i) Udaipur - Rajsamand - Chittorgarh region;</div><div>&nbsp;ii) Makarana - Kishangarh region;&nbsp;</div><div>iii) Banswara - Dungarpur region;</div><div>&nbsp;iv) Andhi (Jaipur) - Jhiri (Alwar) region; and&nbsp;</div><div>v) Jaisalmer region.</div><div><br></div><div>The marbles of Rajasthan are in various colours and shades. The Makrana area is famous for pure white crystalline marble.</div><div>Other varieties found in Makrana area are Albeta, Adanga, Dongri Pink, etc. The marble from Rajsamand area is mined extensively.&nbsp;</div><div>It is off-white and greyish-white.The internationally acclaimed variety of green marble comes from Rikhabdeo-Kesariaji area,&nbsp;</div><div>60 km away from Udaipur. The green marble has various shades of green with white and black network and patches.&nbsp;</div><div>The marble from Babarmal is pink and is marketed as Indian Pink. It is a fine-grained hard marble having black and white bands.</div><div>&nbsp;The marble from Bhilwara is white to off-white, fine to medium-grained hard marble having black and white bands. The marble from&nbsp;</div><div>Banswara is white to off-white dolomitic marble and is soft. It is used generally for cladding purpose. The white to greyish-white&nbsp;</div><div>marbles of Jaipur area are being sold under the trade name Andhi Pista, a white marble having green laths of serpentine;&nbsp;</div><div>onyx; Indo-Italian and Black Marble. The Bhainslana marble is dark-black.</div>', 'img/blog/5/59bcff7e41192.jpg', '2017-09-16 00:00:00', 586, '2017-09-16 10:39:58', 586, 'published', '0000-00-00 00:00:00', 0);
