INSERT INTO `events` (`id`, `name`, `date`, `time`, `location`, `latitude`, `longitude`, `description`, `status`, `cover_image`, `created_on`, `created_by`, `edited_on`, `edited_by`, `published_on`, `published_by`, `event_category_id`) VALUES
(1, 'General Meeting of UCCI ', '2017-06-03', '17:00:00', 'UCCI Bhavan Udaipur ', '', '', '<div> <font>Shri Hans Raj Choudhary was elected as the president for the term on 2017-18&nbsp;</font></div><div><font color="#000000">Shri Ashish Chabbra was elected vice-president&nbsp;</font></div><div><font color="#000000">Out-going president Shri V.P. Rathi spoke about achievements during his term and congratulated the newly elected president&nbsp;</font></div><div><font color="#000000">Last general meeting’s minutes were discussed&nbsp;</font></div><div><font color="#000000">Financials for last term were discussed&nbsp;</font></div><div><font color="#000000">The Executive Committee members were elected: Shri Vinod Kumar Agarwal, Dr. Ajay Murdia, Shri. Sandeep Bapna, Shri Siddharth Singhvi, Shri Manik Nahar, Shri Abhishek Singvi</font></div> ', 'published', 'img/event/1/59bd10bc2c1c8.jpg', '2017-09-16 14:14:30', 586, '2017-09-16 00:00:00', 586, '2017-09-16 00:00:00', 586, 1),
(2, 'Meeting on MSME Projects - 7th June ', '2017-06-07', '17:15:00', 'UCCI Bhavan', '', '', '<div> <font>Principal Secretary for MSME, Dr. Subodh Agarwal, IAS. addressed the industrialists at the meeting and gave an outline of policy changes to improve condition of small and medium businesses</font>  </div><div> <font>President Shri Hans Raj Choudhary expressed his interest in UCCI taking on MSME projects in collaboration with Rajasthan Government</font> </div><div> <font>Many local businesses issues were discussed ranging from the allotment of industrial lands to ease of business and digitisation</font> </div>\r\n', 'published', 'img/event/2/59bd1e4523ef8.jpg', '2017-09-16 14:15:10', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(3, 'Seminar on Quality – 9th June', '2017-06-09', '18:15:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Chairman & Managing Director of Secure Meters, Shri Sanjay Singhal delivered a quintessential talk on quality</font></div><div><font>He emphasized on never to compromise on quality and how to improve the quality of service</font></div><div><font>The seminar was attended by over 100 participants including many eminent members of the industry</font></div>', 'published', 'img/event/3/59bd1f8069475.jpg', '2017-09-16 14:15:27', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(4, 'Executive Meeting', '2017-06-10', '18:15:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>President welcomed the newly elected members of executive committee</font></div> <div><font>First address of the new President, Shri Hans Raj Choudhary</font></div> <div><font>Shri Anil Mishra of J.K. Tyre &amp; Industries Ltd., Kankroli and Shri Jatin Nagori of Amrapali Enterprises, Udaipur were unanimously approved as the co-opted executive members in the Executive Committee for the year 2017-18</font></div> <div><font>Executive Committee unanimously approved Shri Chandra Singh Kothari of Udaipur Automobile Dealers Association as the Executive Committee Member</font></div><div><font>5 Honorary Members of UCCI for the year 2017-18:&nbsp;</font></div><div><font>&nbsp;Shri Ravindra Shrimali, Mayor, Nagar Nigam&nbsp;</font></div><div><font>&nbsp;Shri P.C. Baerwal IAS, District Collector, Rajsamand</font></div><div><font>&nbsp;Shri Rajendra Prasad Goyal, S.P., Udaipur</font></div><div><font>&nbsp;Shri Janat Shah, Director, IIM, Udaipur and&nbsp;</font></div><div><font>Prof. J.P. Sharma, Vice Chancellor, MLSU, Udaipur</font></div>', 'published', 'img/event/4/59bd23204cc23.jpg', '2017-09-16 14:15:48', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(5, 'Workshop for Automobile Association on Adoption of GST', '2017-06-11', '18:15:00', 'UCCCI Bhavan Udaipur', '', '', '<div><font>President expressed his plans to set up a GST cell for easing the adoption of new tax system</font></div><div><font>Major focus on migration of businesses to GST from VAT</font></div><div><font>Q&amp;A on service tax, GST returns and GST website</font></div><div><font>Representative from Tally gave an overview on the effective use of the software post GST</font></div>', 'published', 'img/event/5/59bd232f036f5.jpg', '2017-09-16 14:16:31', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(6, 'Monthly Grievance Committee Meeting ', '2017-06-14', '18:30:00', 'UCCI Bhavan Udaipur', '', '', '<div> <font>Director of District Industries Center Mr. Vipul Jani explained the role of UCCI in acting as a cushion between industry and Government departments</font> </div><div> <font>Plans to organise a camp on online application procedures for PCB registration</font> </div><div> <font>Repair and maintenance related issues discussed</font> </div><div> <font>Proposal for an MoU between UCCI and e-Mitra to be sent to RIICO</font> </div>', 'published', 'img/event/6/59bd24533db0e.jpg', '2017-09-16 14:16:42', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(7, 'Meeting on Mining Related Issues ', '2017-06-23', '18:45:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Meeting attended by 75 mineral mining industrialists</font></div><div><font>Mining related important issues such as effect of GST, Service tax on mining royalty and other new changes discussed</font></div><div><font>Suggestion on setting up a legal cell by UCCI to assist businesses in mining related litigations</font></div><div><font>President gave an outline of GST information services and training cell to be set up by UCCI</font></div>', 'published', 'img/event/7/59bd256c31afc.jpg', '2017-09-16 14:18:28', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(8, 'Meeting of the Marble Industry ', '2017-06-26', '18:45:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Meeting was called in protest of the 28% GST on marble products</font></div><div><font>Marble businessmen decided to call for strike</font></div><div><font>Marble associations and over 100 marble industrialists from Udaipur and nearby districts were present at the meeting</font></div><div><font>President suggested them to present comparative statistics to the Government and GST council along with suggestions and justified arguments</font></div>', 'published', 'img/event/8/59bd26a00f35e.jpg', '2017-09-16 14:18:37', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(9, 'Meeting with Hon. Minister of Mines on the Progress of Mining Industry ', '2017-07-07', '18:45:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Rajasthan’s mines minister Mr. Surendra Pal Sing TT visited UCCI and spoke to mining industrialists on various issues.</font></div><div><font>Discussion on reviewing Mining related Policies of the Government.</font></div><div><font>Mining sub-committee of UCCI proposed a leadership role for the Chamber in future policy developmenta</font></div><div><font>Plantation on 33% area on industrial land. Minister also planted a tree.</font></div>', 'published', 'img/event/9/59bd27004fd7e.jpg', '2017-09-16 14:18:55', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(10, 'Seminar on Impact of GST on Accounting ', '2017-06-29', '18:45:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Expert speaker invited from Indore to explain the changes necessary in accounting and bookkeeping with the introduction of GST</font></div><div><font>Detailed demonstration of integrated accounting software and GST Saathi portal</font></div><div><font>Over 125 participants including many small and medium enterprises attended the seminar</font></div>', 'published', 'img/event/10/59bd27abdab89.jpg', '2017-09-16 14:19:06', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(11, 'Monthly Grievance Committee Meeting ', '2017-07-12', '19:00:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Key Highlights:</font></div><div><font>The President discussed the monitoring of the plantationactivities in the industrial area with PCB representatives</font></div><div><font>Discussion on RIICO to provide land to AVVNL for set up a GSS for the industries located in Gudli</font></div><div><font>The issue of Electrical disruption in UCCI building and the resulting fire due to Transformer blast was put up before AVVNL by our President</font></div><div><font>AVVNL agreed to provide power to UCCI from a dedicated GSS</font></div><div><font>It was assured that issues related to ESIC software will be resolved in next update.</font></div><div><font>New Industrial Loan terms were explained by representative from RFC to the members present</font></div>', 'published', 'img/event/11/59bd2b23c1b35.jpg', '2017-09-16 14:19:16', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(12, 'Seminar on “Impact of GST on Printing Industry” ', '2017-07-12', '19:15:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>A Seminar on “Impact of GST on Printing Industry” was held in the Pyrotech-Tempsens Hall</font></div><div><font>Senior officials from GST department explained the new Tax guidelines in detail.</font></div><div><font>Senior officials from GST department explained the new Tax guidelines in detail.</font></div>', 'published', 'img/event/12/59bd2d6828a18.jpg', '2017-09-16 14:19:25', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(13, 'Seminar on “Impact of GST on Marble, Stones and Handicraft” ', '2017-07-14', '19:15:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>UCCI Organised a Seminar in collaboration with Federation of Indian Export Organizations (FIEO) and Kotak Securities.</font></div><div><font>The event had experts speakers from finance sector like Anindya Banerjee, Deputy Vice President, Kotak Securities and Ahmedabad based CA Mr. Prakash Udeshi, giving advice to exporters present in the seminar.</font></div>', 'published', 'img/event/13/59bd2e3ae4f79.jpg', '2017-09-16 14:19:34', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(14, 'Nitin Gadkari’s Visit ', '2017-07-14', '19:15:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Union Minister for Roads, Highways and Shipping, Shri. Nitin Gadkari Visited UCCI and delivered a stunning discourse on Infrastructure and Economy</font></div><div><font>The Minister also Inaugurated 2 Exceptional Initiatives The GST Cell Vocation Training Center</font></div><div><font>The Event was also Graced by Other High Profile Dignitaries including Shri. Gulabchand Kataria and State Cabinet Minister Shri. Yunus Khan.</font></div>', 'published', 'img/event/14/59bd2f1971c31.jpg', '2017-09-16 14:19:44', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1),
(15, 'UCCI participates in Review Meeting on GST ', '2017-07-16', '19:30:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Meeting with Union Minister of State for Finance and Corporate Affairs, Govt. of India, Shri Arjun Ram Meghwal</font></div><div><font>Officers and representatives of Industry Associations at Zila Parishad were in attendence</font></div><div><font>UCCI President Shri Hans Raj Choudhary, submitted a written Representation from UCCI containing various issues and problems with suggestions to resolve them, to the Minister</font></div><div><font>Dignitaries present were: MP Udaipur, Shri Arjunlal Meena, Chittor MP, Shri C.P. Joshi, Udaipur Zila Pramukh Shri Shantilal Meghwal, District Collector, Shri Vishnu Charan Malik, Central Excise Commissioner, Shri C.K. Jain, Jt. Commissioner, State Tax Department, Ms. Pragya Kewalramani</font></div>', 'published', 'img/event/15/59bd302f4cd61.jpg', '2017-09-16 14:19:51', 586, '0000-00-00 00:00:00', 0, '2017-09-16 00:00:00', 586, 1);
