INSERT INTO `event_histories` (`id`, `event_id`, `name`, `date`, `time`, `location`, `latitude`, `longitude`, `description`, `status`, `cover_image`, `edited_on`, `edited_by`, `published_on`, `published_by`, `event_category_id`) VALUES
(1, 1, 'INDUSTRY AWARENESS PROGRAM ON "ZERO DEFECT AND ZERO EFFECT (ZED) SCHEME FOR MSMEs"', '2018-06-07', '14:00:00', 'UCCI Chamber Udaipur', '', '', '<span style="color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap;">ZED Certification Scheme is an extensive drive of the Government of India to enhance global competitiveness of MSMEs by providing them financial support in assessment, rating and handholding of its manufacturing process on Quality and Environment aspects.</span>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(2, 2, 'HANDLING OF NOTICES ISSUED BY I.T. DEPARTMENT & TO ALLAY THE FEARS REGARDING TAXATION SYSTEM', '2018-06-07', '14:00:00', 'UCCI Chamber Udaipur', '', '', '<span style="color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap;">Income Tax Department has issued notices to various persons who had deposited cash exceeding certain limits during the demonetization period, and for this there seems to be some sort of panic among the tax payers &amp; other persons. </span>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(3, 3, 'Meeting on Mining Issues', '2018-06-07', '16:00:00', 'UCCI Chamber Udaipur', '', '', '<span style="color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap;">As per the today’s announcement by the Government, the Goods &amp; Service Tax Act and Rules are made effective for implementation w.e.f. 1st July, 2017. There are various provisions in the GST concerning mining business/industry and need to be deliberated, discussed and understood in their right earnestness, so that any doubts and ambiguity can be referred to the Government for necessary clarification/amendment before the GST becomes applicable. Besides, the issues on Royalty, Dead rent and Service Tax etc. recently raised in the Court under UCCI platform also need to be discussed for appropriate future course of action. In view of above, an important and urgent meeting of mining fraternity is scheduled to be held on Friday, the 23rd June, 2017 at 4.00 p.m. at UCCI.</span>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(4, 4, 'Interactive Meeting with Dr. Subodh Agrawal, Principal Secretary, MSME', '2018-06-07', '16:00:00', 'UCCI Chamber Udaipur', '', '', '<span style="color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap;">As per detailed Circular sent thru e-mail, Dr. Subodh Agrawal, Principal Secy, MSME as Chief Guest and Shri Bishnu Mallik, Distt Collector, Udaipur as Guest of Honour will visit UCCI for a short Interactive Session with Members on Growth &amp; Development of MSMEs. Kindly make it convenient to attend the Program tomorrow, 7 June 2017 at 4 pm to be followed by Hi Tea. Regards, UCCI</span>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(5, 1, 'General Meeting of UCCI ', '2017-09-16', '17:00:00', 'UCCI Bhavan Udaipur ', '', '', '<div style="margin-top: 6pt; margin-bottom: 0pt; margin-left: 0.3in; text-indent: -0.3in; direction: ltr; unicode-bidi: embed; word-break: normal;"><span style="font-size: medium;"><span style="color: rgb(254, 134, 55); font-family: Wingdings;">¢</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Shri</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;"> Hans Raj </span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Choudhary</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;"> was elected as the president for the\r\nterm od 2017-18</span></span></div>\r\n\r\n<div style="margin-top: 6pt; margin-bottom: 0pt; margin-left: 0.3in; text-indent: -0.3in; direction: ltr; unicode-bidi: embed; word-break: normal;"><span style="font-size: medium;"><span style="color: rgb(254, 134, 55); font-family: Wingdings;">¢</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Shri</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;"> </span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Ashish</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;"> </span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Chabbra</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;"> was elected vice-president</span></span></div>\r\n\r\n<div style="margin-top: 6pt; margin-bottom: 0pt; margin-left: 0.3in; text-indent: -0.3in; direction: ltr; unicode-bidi: embed; word-break: normal;"><span style="font-size: medium;"><span style="color: rgb(254, 134, 55); font-family: Wingdings;">¢</span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Out-going\r\npresident </span><span style="font-family: &quot;Century Schoolbook&quot;; color: black;">Shri