(9, 5, 'Workshop for Automobile Association on Adoption of GST', '2017-09-20', '18:15:00', 'UCCCI Bhavan Udaipur', '', '', '<div><font>President expressed his plans to set up a GST cell for easing the adoption of new tax system</font></div><div><font>Major focus on migration of businesses to GST from VAT</font></div><div><font>Q&amp;A on service tax, GST returns and GST website</font></div><div><font>Representative from Tally gave an overview on the effective use of the software post GST</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(10, 6, 'Monthly Grievance Committee Meeting ', '2017-09-16', '18:30:00', 'UCCI Bhavan Udaipur', '', '', '<div> <font>Director of District Industries Center Mr. Vipul Jani explained the role of UCCI in acting as a cushion between industry and Government departments</font> </div><div> <font>Plans to organise a camp on online application procedures for PCB registration</font> </div><div> <font>Repair and maintenance related issues discussed</font> </div><div> <font>Proposal for an MoU between UCCI and e-Mitra to be sent to RIICO</font> </div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(11, 7, 'Meeting on Mining Related Issues ', '2017-09-16', '18:45:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Meeting attended by 75 mineral mining industrialists</font></div><div><font>Mining related important issues such as effect of GST, Service tax on mining royalty and other new changes discussed</font></div><div><font>Suggestion on setting up a legal cell by UCCI to assist businesses in mining related litigations</font></div><div><font>President gave an outline of GST information services and training cell to be set up by UCCI</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(12, 8, 'Meeting of the Marble Industry ', '2017-09-16', '18:45:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Meeting was called in protest of the 28% GST on marble products</font></div><div><font>Marble businessmen decided to call for strike</font></div><div><font>Marble associations and over 100 marble industrialists from Udaipur and nearby districts were present at the meeting</font></div><div><font>President suggested them to present comparative statistics to the Government and GST council along with suggestions and justified arguments</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(13, 9, 'Meeting with Hon. Minister of Mines on the Progress of Mining Industry ', '2017-09-22', '18:45:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Rajasthan’s mines minister Mr. Surendra Pal Sing TT visited UCCI and spoke to mining industrialists on various issues.</font></div><div><font>Discussion on reviewing Mining related Policies of the Government.</font></div><div><font>Mining sub-committee of UCCI proposed a leadership role for the Chamber in future policy developmenta</font></div><div><font>Plantation on 33% area on industrial land. Minister also planted a tree.</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(14, 10, 'Seminar on Impact of GST on Accounting ', '2017-09-16', '18:45:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Expert speaker invited from Indore to explain the changes necessary in accounting and bookkeeping with the introduction of GST</font></div><div><font>Detailed demonstration of integrated accounting software and GST Saathi portal</font></div><div><font>Over 125 participants including many small and medium enterprises attended the seminar</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(15, 11, 'Monthly Grievance Committee Meeting ', '2017-09-16', '19:00:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Key Highlights:</font></div><div><font>The President discussed the monitoring of the plantationactivities in the industrial area with PCB representatives</font></div><div><font>Discussion on RIICO to provide land to AVVNL for set up a GSS for the industries located in Gudli</font></div><div><font>The issue of Electrical disruption in UCCI building and the resulting fire due to Transformer blast was put up before AVVNL by our President</font></div><div><font>AVVNL agreed to provide power to UCCI from a dedicated GSS</font></div><div><font>It was assured that issues related to ESIC software will be resolved in next update.</font></div><div><font>New Industrial Loan terms were explained by representative from RFC to the members present</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(16, 12, 'Seminar on “Impact of GST on Printing Industry” ', '2017-09-16', '19:15:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>A Seminar on “Impact of GST on Printing Industry” was held in the Pyrotech-Tempsens Hall</font></div><div><font>Senior officials from GST department explained the new Tax guidelines in detail.</font></div><div><font>Senior officials from GST department explained the new Tax guidelines in detail.</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(17, 13, 'Seminar on “Impact of GST on Marble, Stones and Handicraft” ', '2017-09-16', '19:15:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>UCCI Organised a Seminar in collaboration with Federation of Indian Export Organizations (FIEO) and Kotak Securities.</font></div><div><font>The event had experts speakers from finance sector like Anindya Banerjee, Deputy Vice President, Kotak Securities and Ahmedabad based CA Mr. Prakash Udeshi, giving advice to exporters present in the seminar.</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(18, 14, 'Nitin Gadkari’s Visit ', '2017-09-16', '19:15:00', 'UCCI Bhavan Udaipur ', '', '', '<div><font>Union Minister for Roads, Highways and Shipping, Shri. Nitin Gadkari Visited UCCI and delivered a stunning discourse on Infrastructure and Economy</font></div><div><font>The Minister also Inaugurated 2 Exceptional Initiatives The GST Cell Vocation Training Center</font></div><div><font>The Event was also Graced by Other High Profile Dignitaries including Shri. Gulabchand Kataria and State Cabinet Minister Shri. Yunus Khan.</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1),
(19, 15, 'UCCI participates in Review Meeting on GST ', '2017-09-16', '19:30:00', 'UCCI Bhavan Udaipur', '', '', '<div><font>Meeting with Union Minister of State for Finance and Corporate Affairs, Govt. of India, Shri Arjun Ram Meghwal</font></div><div><font>Officers and representatives of Industry Associations at Zila Parishad were in attendence</font></div><div><font>UCCI President Shri Hans Raj Choudhary, submitted a written Representation from UCCI containing various issues and problems with suggestions to resolve them, to the Minister</font></div><div><font>Dignitaries present were: MP Udaipur, Shri Arjunlal Meena, Chittor MP, Shri C.P. Joshi, Udaipur Zila Pramukh Shri Shantilal Meghwal, District Collector, Shri Vishnu Charan Malik, Central Excise Commissioner, Shri C.K. Jain, Jt. Commissioner, State Tax Department, Ms. Pragya Kewalramani</font></div>', 'draft', '', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 1);
