INSERT INTO `initiatives` (`id`, `title`, `initiative_category_id`, `description`, `created_on`, `created_by`, `edited_on`, `edited_by`, `icon_photo`, `description_photo`) VALUES
(1, 'Vocation Training Center', 1, '<div class="vc_row wpb_row vc_row-fluid vc_custom_1498892854954" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 75px !important; padding-bottom: 10px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-12" style="width: 1140px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 0px; padding-right: 0px; width: 1140px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">UCCI Vocational Training Centre has successfully begun teaching 3 batches at the Chamber Bhavan. Our programme for accountancy professionals on how to adopt GST at their work has received marvellous response from both the experienced as well as recent graduates.</p></div></div></div></div></div></div></div><div class="vc_row wpb_row vc_row-fluid vc_custom_1502539693294" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 0px !important; padding-bottom: 20px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_single_image wpb_content_element vc_align_left" style="margin-bottom: 35px;"><figure class="wpb_wrapper vc_figure" style="display: inline-block; vertical-align: top; max-width: 100%;"><div class="vc_single_image-wrapper   vc_box_border_grey" style="display: inline-block; vertical-align: top; max-width: 100%;"><img width="743" height="565" src="http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-VTC.png" class="vc_single_image-img attachment-full" alt="" srcset="http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-VTC.png 743w, http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-VTC-300x228.png 300w" sizes="(max-width: 743px) 100vw, 743px" style="vertical-align: top; height: auto; max-width: 100%;"></div></figure></div></div></div></div><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">The programme covers extensive topics ranging from Tally ERP 9 to MS Office Suite for office management. It’s worth mentioning that UCCI has engaged well known Tally experts and CAs working in the industry to teach this course. It is an excellent opportunity to not only learn new techniques in accounting but also to get a refresher on accounting fundamentals. The programme has two levels. First is for beginners who need a comprehensive overview of Accountancy related skills. The second is for those who are already employed in the industry and need a deeper understanding of GST implementation. We invite UCCI members to sponsor select economically underprivileged students for the programme. We are also looking forward to getting the students placed in suitable jobs. If you have openings related to accountancy at your organization, please send us details with an Expression of Interest in hiring from VTC. We’ll get in touch with your HR. We solemnly seek your kind support and encouragement for the success of this initiative.</p></div></div></div></div></div></div></div>', '2017-08-16 09:26:11', 586, '2017-09-27 09:13:01', 586, 'img/initiative/59b67c17f0ad1.png', 'img/initiative/59b7c0e86c8a8.png'),
(2, 'Digital Library', 5, '<div class="vc_row wpb_row vc_row-fluid vc_custom_1502539693294" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 0px !important; padding-bottom: 20px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p class="MsoNormal" style="text-align: justify;"><span lang="EN-IN" style="font-size: medium;">UCCI Initiated E library user friendly\r\nproject aim to developed framework virtual vault of informations and learning\r\nresources with single window search Facility for all its members and Non members.\r\nOur E-Library is Pylon of Informations that provides you 24 Hours access to audio,\r\nvideo, and written materials which pertains to all respective government\r\ndepartments. Filtered and federated searching option is customized in order to\r\nfacilitate the users which display accurate informations to them with least\r\nefforts in minimum time along with means for organizing, storing, and\r\nretrieving the files and media contained in the library collections.</span></p><p class="MsoNormal" style="text-align: justify;"><b><span lang="EN-IN" style="font-size: medium;">Benefits:-<o:p></o:p></span></b></p><p class="MsoListParagraphCxSpFirst" style="text-align: justify; text-indent: -0.25in;"><!--[if !supportLists]--><span style="font-size: medium;"><b><span lang="EN-IN">1.<span style="font-variant-numeric: normal; font-weight: normal; font-stretch: normal; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;</span></span></b><b><span lang="EN-IN">Peerless Browse options-</span></b><span lang="EN-IN">Users can browse Informations by versatile Options available to him in\r\nvarious categories, content Type, Subject, and Department wise, Keywords\r\n(Phrase, Word) which signifies complete informations.</span></span></p><p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -0.25in;"><!--[if !supportLists]--><span style="font-size: medium;"><b><span lang="EN-IN">2.<span style="font-variant-numeric: normal; font-weight: normal; font-stretch: normal; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;</span></span></b><b><span lang="EN-IN">Avoid Physical Boundary\r\nand save time-</span></b><span lang="EN-IN">Users can avoid visiting the Physical\r\nlibrary or any Govt Department to gather informations every time which also saves\r\ntime.</span></span></p><p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -0.25in;"><!--[if !supportLists]--><span style="font-size: medium;"><b><span lang="EN-IN">3.<span style="font-variant-numeric: normal; font-weight: normal; font-stretch: normal; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp; &nbsp;</span></span></b><b><span lang="EN-IN">Information retrieval\r\nsystem- </span></b><span lang="EN-IN">Our information retrieval system is\r\ndesigned on user friendly interface provides complete informations on single\r\nclick.</span></span></p><p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -0.25in;"><!--[if !supportLists]--><span style="font-size: medium;"><b><span lang="EN-IN">4.<span style="font-variant-numeric: normal; font-weight: normal; font-stretch: normal; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;</span></span></b><b><span lang="EN-IN">Interlinked exploration of\r\ninformation from multiple sources under one roof- </span></b><span lang="EN-IN">Our\r\nLibrary is designed with facet based refinement options.<b><o:p></o:p></b></span></span></p><p style="margin-bottom: 0px; line-height: 1.85714em; text-align: justify;">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoListParagraphCxSpLast" style="text-align: justify; text-indent: -0.25in;"><!--[if !supportLists]--><span style="font-size: medium;"><b><span lang="EN-IN">5.<span style="font-variant-numeric: normal; font-weight: normal; font-stretch: normal; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;</span></span></b><b><span lang="EN-IN">Storage capacity-</span></b></span><span lang="EN-IN"><span style="font-size: medium;"> Digital libraries have the potential to store much more\r\ninformations simply because digital information requires very little physical\r\nspace to contain them and media storage technologies are more affordable than\r\never before.</span><b><o:p></o:p></b></span></p></div></div></div></div></div></div></div>', '2017-08-16 09:27:05', 586, '2017-09-16 09:44:09', 586, 'img/initiative/59b67b5aa032f.png', 'img/initiative/59b7c113d7193.jpg'),
(3, 'GST Cell', 2, '<div class="vc_row wpb_row vc_row-fluid vc_custom_1498892854954" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 75px !important; padding-bottom: 10px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-12" style="width: 1140px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 0px; padding-right: 0px; width: 1140px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">A GST cell has been set up at Chamber Bhawan by Udaipur Chamber ofCommerce &amp; Industry to assist the members as well as non-members for the queries regarding GST.</p></div></div></div></div></div></div></div><div class="vc_row wpb_row vc_row-fluid vc_custom_1502539693294" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 0px !important; padding-bottom: 20px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_single_image wpb_content_element vc_align_left" style="margin-bottom: 35px;"><figure class="wpb_wrapper vc_figure" style="display: inline-block; vertical-align: top; max-width: 100%;"><div class="vc_single_image-wrapper   vc_box_border_grey" style="display: inline-block; vertical-align: top; max-width: 100%;"><img width="744" height="565" src="http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-GST.png" class="vc_single_image-img attachment-full" alt="" srcset="http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-GST.png 744w, http://www.ucciudaipur.com/wp-content/uploads/2017/08/UCCI-GST-300x228.png 300w" sizes="(max-width: 744px) 100vw, 744px" style="vertical-align: top; height: auto; max-width: 100%;"></div></figure></div></div></div></div><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 20px; line-height: 1.85714em; font-size: 16px; text-align: justify;">The GST cell is being looked after by GST Committee, which is headed by Shri Anil Mishra, the Hon. The committee consists ofthe following members with President, Shri Hansraj Choudhary asex-officio member:</p><ol style="line-height: 25px; font-size: 16px; text-align: justify;"><li>ShriAnil Mishra, Chairman</li><li>CA.Anshul Mogra, Member</li><li>CA. Prateek Hinger, Member</li><li style="margin-bottom: 0px;">CA. Devendra Kumar Somani, Member</li></ol><p style="margin-bottom: 20px; line-height: 25px; font-size: 16px; text-align: justify;">GST CELL has been established by UCCI and for this, the Chamber has appointed M/s Sarupria Somani &amp; Associates, Chartered Accountants, Udaipur. The CA firm is well established having 30 years of experience.</p><p style="margin-bottom: 0px; line-height: 25px; font-size: 16px; text-align: justify;">The firm&nbsp;<span style="font-weight: 700;">has Pan&nbsp;</span><span style="font-weight: 700; margin-bottom: 0px;">India presence&nbsp;</span>at Udaipur, Mumbai, Delhi, Jaipur,Ahmedabad, Indore, Pune, Bhavnagar, Akola &amp; Singrauli with associates in other major cities like Kolkota, Banglore, Chennai, Hyderabad, Kanpur, Lucknow.</p></div></div></div></div></div></div></div><div class="vc_row wpb_row vc_row-fluid vc_custom_1502539683518" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 0px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-12" style="width: 1140px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 0px; padding-right: 0px; width: 1140px;"><div class="wpb_wrapper"><h4 class="vc_custom_heading" style="font-family: " abril="" fatface";="" color:="" rgb(5,="" 7,="" 9);="" font-size:="" 19.6px;"="">About GST : One Nation One Tax</h4><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">GST is one indirect tax for the whole nation, which will make India one unified common market. GST is a single tax on the supply of goods and services, right from the manufacturer upto the consumer. Credits of input taxes paid at each<br style="margin-bottom: 0px;">stage are mostly available in the subsequent stage of value addition, making GST essentially a tax only on value addition at each stage. Thus, the final consumer bears only the GST charged by the last dealer in the supply chain, with set-off benefits at all the previous stages.</p></div></div></div></div></div></div></div>', '2017-08-16 09:28:16', 586, '2017-09-27 09:11:15', 586, 'img/initiative/59bcc40b4244d.png', 'img/initiative/59b7c1240218a.png'),
(4, 'Hazardous Waste Management', 3, '<span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;">The jewel in the crown of all UCCI completed projects. This project was envisaged to ensure that the hazardous industrial waste generated by various polluting industries which up to then were left untreated, now through the Common Hazardous Waste Treatment, Storage and Disposal Facility had an effective and easily accessible option to manage their hazardous waste.</span><div style="text-align: center;"><img src="http://www.ucciudaipur.com/wp-content/uploads/2017/08/PDFtoJPG.me-042.jpg"><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;"><br></span></div><div style="text-align: center;"><br></div><div style="text-align: left;"><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;">This project piloted by UCCI from its inception in 1998 till its commissioning in 2006 was professionally handled and that the Supreme Court appointed subcommittee monitoring the project had classifid this facility as A+ category and appreciated the joint efforts of GOR, RSPCB and UCCI for successfully evolving an exemplary private-public partnership model which speaks volumes of the dedication of those involved. Today 796 industries located in different districts of Rajasthan are registered as members using this facility on a regular basis.</span><br></div>', '2017-08-16 09:29:01', 586, '2017-09-27 09:14:52', 586, 'img/initiative/59b67bc09874d.png', 'img/initiative/59b7c14610c71.jpg'),
(5, 'Excellence Awards', 1, '<div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 20px; line-height: 1.85714em; font-size: 16px; text-align: justify;">CSR activities of business&nbsp; are inspired by the vision of the better world and are an attempt to do something about it through volunteerism, investment and ethical, sustainable business practices through spirit, drive and vision.</p><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">This award recognizes a modal of business excellence for outstanding social community service and CSR endeavors reflecting well thought out activities and high-impact of contributions made towards the well-being of the community as a whole. Moreover, it is recognition and reward their efforts that encourage more companies to commit to making a positive, beneficial impact on their customers, their suppliers, their employees and their families and community.</p><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;="" text-align:="" center;"="">Eligibility Criteria</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><ol style="margin-bottom: 0px; font-size: 16px; text-align: justify; line-height: 1.85714em;"><li>Awards is given to firm or company and not to an individual.</li><li>Any firm or company having investment in Plant &amp; Machinery above Rs. 25 Lakhs, and which has manufacturing unit located in any of the following districts of Rajasthan : Udaipur, Sirohi, Dungarpur, Banswara, Chittorgarh, Rajsamand, Bhilwara &amp; Pratapgarh, were eligible for the awards.</li><li>Any firm/company having its registered office outside Rajasthan&nbsp; could apply provided the manufacturing unit is in Rajasthan&nbsp; in any of the above specified districts of Rajasthan.</li><li style="margin-bottom: 0px;">Any mining firm/company independently did not qualify for the awards, but if it has&nbsp;manufacturing&nbsp; unit also, i.e. mineral or stone processing unit, it was entitled to apply.</li></ol><div style="text-align: justify;"><span style="font-size: 16px;"><br></span></div><div style="text-align: justify;"><span style="font-size: 16px;"><br></span></div><div style="text-align: center;"><img width="666" height="347" src="http://www.ucciudaipur.com/wp-content/uploads/2017/08/imgsgallery8.jpg" class="vc_single_image-img attachment-full" alt="" srcset="http://www.ucciudaipur.com/wp-content/uploads/2017/08/imgsgallery8.jpg 666w, http://www.ucciudaipur.com/wp-content/uploads/2017/08/imgsgallery8-300x156.jpg 300w" sizes="(max-width: 666px) 100vw, 666px" style="vertical-align: top; height: auto; max-width: 100%; text-align: left;"></div><div style="text-align: center;"><br></div><div style="text-align: center;"><br></div><div style="text-align: left;"><h2 class="title" style="font-family: " josefin="" sans",="" sans-serif;="" font-weight:="" 600;="" color:="" rgb(5,="" 7,="" 9);="" margin-top:="" 0px;="" margin-bottom:="" 30px;="" font-size:="" 2.85714em;="" text-align:="" center;"="">Application For Awards</h2><div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">Lifetime Achievement Awards 2017</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">Shri Laxmi Niwas Jhunjhunwala</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">Mr. L.N. Jhunjhunwala is the founder and chairman Emeritus of LNJ Bhilwara Group, having diversified interest in textiles sponge iron, graphite and energy. Born on 17th October, 1928 at Mukundgarh in Rajasthan, Mr. Jhunjhunwala holsd B.A. Maths (Hons) from Calcutta University in 1945 and Post graduation in Mathematics from pune.</p></div></div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">The Winner of Vedanta Hindustan Zinc CSR Awards 2017</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">J.K. Tyre &amp; Industries Ltd.</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">JK Tyre &amp; Industries Ltd. is a part of century-old JK Organization, one of India’s leading private sector conglomerates with a multi-product, multi-location and multi-business operation.</p></div></div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">The Winner of Pyrotech Tempsens Large Enterprise Awards - Manufacturing</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">Nitin Spinners Limited</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">Nitin Spinners Limited, Promoted by Shri R.L. Nolkha, Shri Dinesh Nolkha and Shri Nitin Nolkha&nbsp; was incorporated On the 15th October 1992 at Hamirgarh, Bhilwara, Rajasthan.&nbsp; The company is mainly engaged in the manufacturing of cotton yarn and cotton knitted fabrics.</p></div></div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">The Winner of Arcgate Mid-Corporatate Enterprise Awards - Manufacturing</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">Rajasthan Barytes Ltd.</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">Rajasthan Barytes Ltd. was founded in the year 1982 as a joint venture with Rajasthan State Mineral Development Corporation – a government of Rajasthan undertaking. The company started mining of mineral Barytes which is a very unique mineral.</p></div></div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">The Winner of Mewar Hi-Tech Medium Enterprise Award - Manufacturing</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">Madhusudan Marbles Pvt. Ltd.</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">M/s Madhusudan group was established with company Name Madhusudan Mineral Pvt. Ltd. in<br>Makrana (Rajasthan) in 1976 By Shri Satyanarayan Kabra Father of Shri Basant and Mukesh<br style="margin-bottom: 0px;">Kabra. The company is engaged into manufacturing &amp; processing of all Natural Stone (Marble, Granites, Sand Stone) slabs &amp; tiles.</p></div></div><h2 class="vc_custom_heading" style="font-family: " open="" sans";="" color:="" rgb(77,="" 86,="" 87);="" margin-top:="" 30px;="" margin-bottom:="" 15px;="" font-size:="" 25.2px;"="">The Winner of Singhal Foundation Small Enterprise Award - Manufacturing</h2><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><h4 style="font-weight: 700; color: rgb(5, 7, 9); font-size: 19.6px; font-family: " josefin="" sans",="" sans-serif="" !important;"="">GG Values Pvt. Td.</h4><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">Relocated at Udaipur in 1997 from Mumbai, GG Value is one of the high quality value manufacturers<br style="margin-bottom: 0px;">with high brand value. Strict quality measures are taken at each stage from checking raw materials, stage inspection to the final components, assembly and packing.</p></div></div></div></div></div></div></div></div>', '2017-08-16 09:30:04', 586, '2017-09-27 09:15:42', 586, 'img/initiative/59b67bf379e36.png', 'img/initiative/59b7c16bc1163.jpg'),
(6, 'Cafeteria', 6, '<div class="vc_row wpb_row vc_row-fluid vc_custom_1502539693294" style="margin-left: 0px; margin-right: 0px; color: rgb(90, 90, 90); font-family: Roboto, sans-serif; padding-top: 0px !important; padding-bottom: 20px !important;"><div class="container"><div class="wpb_column vc_column_container vc_col-sm-6" style="width: 570px; position: relative; min-height: 1px; padding-left: 0px; padding-right: 0px; float: left;"><div class="vc_column-inner " style="padding-left: 15px; padding-right: 15px; width: 570px;"><div class="wpb_wrapper"><div class="wpb_text_column wpb_content_element " style="margin-bottom: 35px;"><div class="wpb_wrapper" style="margin-bottom: 0px;"><p style="margin-bottom: 0px; line-height: 1.85714em; font-size: 16px; text-align: justify;">Soon to be open cafeteria has been in plans for a while. As the number of people visiting the chamber has increased, so has the need for a regular cafeteria. The housing is already constructed and the cafeteria is to be inaugurated on 16th September this year.</p></div></div></div></div></div></div></div>', '2017-08-16 09:30:53', 586, '2017-09-16 09:45:23', 586, 'img/initiative/59b67c3e00f44.png', 'img/initiative/59b7c199f1f05.jpg');
