(1, 1, 1, '1', 'UTGST & Compensation Cess Rate Notifications', '<p style="margin: 0cm 0cm 0.0001pt; color: rgb(0, 0, 0);"><span style="font-size: small; font-family: verdana, sans-serif;"><span lang="EN-US">Please&nbsp;find attached following updates:</span><span lang="EN-US"></span></span></p><p style="margin: 0cm 0cm 0.0001pt; color: rgb(0, 0, 0);"><span lang="EN-US" style="font-size: small; font-family: verdana, sans-serif;">&nbsp;</span></p><table class="x_MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); width: 985.556px;"><tbody><tr><td width="100%" colspan="2" valign="top" style="width: 970.069px; border: 1pt solid windowtext; padding: 0cm 5.4pt;"><p align="center" style="margin: 0cm 0cm 0.0001pt; text-align: center; line-height: 18.4px;"><b><span lang="EN-GB" style="line-height: 15.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: small; font-family: verdana, sans-serif;">UNION TERRITORY TAX</span></b></p></td></tr><tr><td width="29%" valign="top" style="width: 278.958px; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none; padding: 0cm 5.4pt;"><p align="center" style="margin: 0cm 0cm 0.0001pt; text-align: center; line-height: 18.4px;"><span lang="EN-GB" style="line-height: 15.3333px; font-size: small; font-family: verdana, sans-serif;">Notification No. 1 - Rate<b></b></span></p></td><td width="70%" valign="top" style="width: 675.625px; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0cm 5.4pt;"><p style="margin: 0cm 0cm 0.0001pt; line-height: 18.4px;"><span lang="EN-GB" style="line-height: 15.3333px; font-size: small; font-family: verdana, sans