(8, 1, 1, '1', 'Interaction Meeting with Hon''ble Mines Minister held on 07.07.2017 at UCCI', '<div><span style="font-family: LatoHairline;">Please find attached brief on Interaction Meeting with Hon''ble Mines Minister Shri Surendrapal Singh T.T.&nbsp;</span></div><span style="font-family: LatoHairline;"><div><span style="font-family: LatoHairline;"><br></span></div><div><span style="font-family: LatoHairline;">Regards,</span></div><div><span style="font-family: LatoHairline;"><br></span></div><div>Anil Mishra</div>Hony. Secretary General</span>', 'true', '2017-07-13 09:28:55'),
(9, 1, 1, '1', 'AWARENESS PROGRAM ON GST FOR PRINTING BUSINESS ORGANISATIONS', '<div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><div><div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Kindly find attached our Circular on Interactive Meeting on Impact of GST on Printing &amp; Paper Industry on Wednesday, the 12 July 2017 at 2.30 pm at UCCI.</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Regards,</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Anil Mishra</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(33, 33, 33);">Hony. Secretary General</p>', 'true', '2017-07-13 09:28:55'),
(10, 1, 1, '1', 'WORKSHOP ON IMPACT OF GST ON MARBLE, STONE, HANDICRAFT AND ON CURRENCY EXCHANGE - 14-7-2017, 5 PM', '<div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><div><div><div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Kindly find attached herewith Program Circular on captioned subject, scheduled to be held at UCCI on 14-07-2017 at 5.00 pm to be followed by Dinner.</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">The program is jointly organized by UCCI, FIEO &amp; Kotak Securities with Chief Guest Shri Virendra Singh, Joint DGFT, Jaipur.</p></div><div><p class="x_MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">CA Prakash Udeshi from Ahmedabad and Mr. Ananya Banerjee, Dy. Vice President, Kotak Securities, Mumbai shall be the Resource Persons.</p></div><div><p class="x_MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">&nbsp;</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Regards,</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;">Anil Mishra</p></div><p class="x_MsoNormal" style="margin: 0cm 0cm 12pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(33, 33, 33);">Hony. Secretary General</p>', 'true', '2017-07-13 09:28:55'),
(11, 1, 1, '1,2', 'Invitation for Interaction Meeting on Economic Growth of Rajasthan with Development of Roads & Infrastructure', '<p class="MsoNormal">UCCI requests the pleasure of your company for felicitate\r\n&amp; interact with Shri Nitin Gadkari, Hon''ble Minister of Road Transport,\r\nHighways &amp; Shipping, Govt. of India on Friday, the 14 July 2017 at 4.30 pm\r\nat PP Singhal Auditorium, UCCI.</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Kindly find the Invitation Card of above program in\r\nattachment.&nbsp;</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Regards,</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Anil Mishra</p>\r\n\r\n<p class="MsoNormal">Hony. Secretary General</p>', 'true', '2017-07-13 09:39:54'),
(12, 1, 1, '1,2', 'Interaction Meeting with Hon''ble Union Minister Shri Nitin Gadkari', 'Please find attached Weekly News Letter dated 14.7.2017<div><br></div><div>With best regards,</div><div><br></div><div>Anil Mishra</div><div>Hony. Secretary General</div><div><br></div>', 'true', '2017-07-14 16:13:52'),
(13, 1, 1, '1', 'WNL dated 12 July 2017 and 14.7.2017', '<div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;">Please find attached the Weekly News Letters dated 14th June 2017 and Samasya Samadhan Shivir dated 12th June 2017 for your perusal &amp; kind information.</span></div><div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;"><br></span></div><div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;">Regards,</span></div><div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;"><br></span></div><div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;">Anil Mishra</span></div><div style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;"><span style="font-family: verdana, sans-serif, serif, EmojiFont;">Hony. Secretary Genera</span></div>', 'true', '2017-07-16 16:26:10'),
(14, 1, 1, '1,2', 'AVVNL Order for authorizing Chartered Electrical Safety Engineer', 'Please find the attachment on the subject for perusal and information.<div><br></div><div>Regards,</div><div><br></div><div>Anil Mishra</div><div>Hony. Secretary General</div><div><br></div>', 'true', '2017-07-18 07:35:45'),
(15, 1, 1, '1,2', 'GST CELL AT UCCI', '<p class="MsoNormal">It is for\r\nkind information of our members that the GST Cell has recently been inaugurated at UCCI by Hon’ble Minister for Road Transport,\r\nHighways &amp; Shipping, Govt. of India, Shri Nitin Gadkari on 14<sup>th</sup>\r\nJuly, 2017. </p>\r\n\r\n<p class="MsoNormal">We are glad to\r\nannounce that the Cell has started offering necessary guidance and consultancy\r\nto the members as well as non-members. The Cell operates 3-days a week i.e.\r\nMonday, Wednesday and Friday between 10 a.m. to 2 p.m.<br></p>\r\n\r\n<p class="MsoNormal">We request our\r\nesteemed members to kindly register themselves to avail the specialized\r\nservices of the GST Cell, being provided by eminent GST experts/CAs.<br></p>\r\n\r\n<p class="MsoNormal">The services\r\n&amp; the membership details of the GST Cell can be found on the UCCI website.<br></p>\r\n\r\n<p class="MsoNormal">Regards,<br></p>\r\n\r\n<p class="MsoNormal">Anil Mishra<br></p>\r\n\r\n<p class="MsoNormal">Hony.\r\nSecretary General</p><p class="MsoNormal">&nbsp;</p>', 'false', '2017-07-20 06:53:34'),
(16, 1, 1, '1,2', 'SEMINAR ON “VARIOUS DEVELOPMENT TAKING PLACE IN THE I.T. DEPTT. IN THE DIRECTION OF TAKING IT TO A SERVICE ORIENTED DEPTT.” ORGANIZED BY I.T. DEPTT. DURING CELEBRATION OF “AYAKAR DIVAS” ON 24.7.2017 AT ICAI BHAWAN', '<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">Income Tax Department, Udaipur\r\nhas intimated us that the Department is graciously celebrating “AYAKAR DIVAS” on\r\n24<sup>th</sup> July, 2017 and on this eve, they would be organizing a Seminar\r\non “Various Development taking place in the Department in the direction of\r\ntaking it to a service oriented department” on 24<sup>th</sup> July, 2017 at 3\r\nto 6 p.m. at ICAI Bhawan, G-Block, Hiran Magri Sector 14, Udaipur.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">They have cordially invited the\r\nmembers of UCCI to participate in above Seminar.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">Members are, therefore,\r\nrequested to kindly make it convenient to attend above Seminar.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" align="left"><span style="color:black;mso-fareast-language:EN-US">Anil Mishra<o:p></o:p></span></p>\r\n\r\n<span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA">Hony. Secretary General</span><div><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA"><br></span></div>', 'false', '2017-07-20 07:01:55'),
(17, 2, 1, '', 'Meeting with Shri Salil Singhal on 29.7.2017, 6.30 pm at UCCI', '<p class="x_MsoNormal" align="left" style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;">Dear Sir,</p><p class="x_MsoNormal" align="left" style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;">It is a matter of pleasure to inform you that Shri Salil Singhal has kindly consented to visit UCCI and have a networking meeting with us on 29<sup>th</sup>&nbsp;July, 2017 at 6.30 p.m.</p><p class="x_MsoNormal" align="left" style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;">You are requested to kindly make it convenient to participate in above meeting, which will be followed by hi-tea.</p><p class="x_MsoNormal" align="left" style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;">Regards,</p><p class="x_MsoNormal" align="left" style="color: rgb(33, 33, 33); font-family: wf_segoe-ui_normal, &quot;Segoe UI&quot;, &quot;Segoe WP&quot;, Tahoma, Arial, sans-serif, serif, EmojiFont; font-size: 15px;">Hans Raj Choudhary</p>', 'false', '2017-07-24 05:20:47'),
