(25, 1, 1, '1', 'Tally Discount For UCCI Members', '<p class="MsoNormal"><span style="color:black">It is for the benefit of all UCCI Members. We are in the\r\nprocess of obtaining licensed Tally software for your accounting needs at a discounted\r\nprice. Interested member may please send us expression of interest for buying\r\nTally.ERP9 (Single or Multi-user) as a part of business requirement. Kindly\r\nmail us or message us your EoI within 7 working days.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">Email:&nbsp;<a href="mailto:uccisec@gmail.com" target="_blank">uccisec@gmail.com</a><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">Mob/Whatsapp: +91 7725912045<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">Best Regards,<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="color:black">Anil Mishra<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:9.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:black">Hony.\r\nSecretary General</span><span style="color:black"><o:p></o:p></span></p>', 'false', '2017-08-16 13:08:06'),
(26, 1, 1, '1', 'UCCI Vocational Training Center Getting Great Response for GST Skilled Accountants Programme ', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><!--[if gte vml 1]><v:shapetype\r\n id="_x0000_t75" coordsize="21600,21600" o:spt="75" o:preferrelative="t"\r\n path="m@4@5l@4@11@9@11@9@5xe" filled="f" stroked="f">\r\n <v:stroke joinstyle="miter"/>\r\n <v:formulas>\r\n  <v:f eqn="if lineDrawn pixelLineWidth 0"/>\r\n  <v:f eqn="sum @0 1 0"/>\r\n  <v:f eqn="sum 0 0 @1"/>\r\n  <v:f eqn="prod @2 1 2"/>\r\n  <v:f eqn="prod @3 21600 pixelWidth"/>\r\n  <v:f eqn="prod @3 21600 pixelHeight"/>\r\n  <v:f eqn="sum @0 0 1"/>\r\n  <v:f eqn="prod @6 1 2"/>\r\n  <v:f eqn="prod @7 21600 pixelWidth"/>\r\n  <v:f eqn="sum @8 21600 0"/>\r\n  <v:f eqn="prod @7 21600 pixelHeight"/>\r\n  <v:f eqn="sum @10 21600 0"/>\r\n </v:formulas>\r\n <v:path o:extrusionok="f" gradientshapeok="t" o:connecttype="rect"/>\r\n <o:lock v:ext="edit" aspectratio="t"/>\r\n</v:shapetype><v:shape id="Picture_x0020_3" o:spid="_x0000_s1026" type="#_x0000_t75"\r\n style=''position:absolute;left:0;text-align:left;margin-left:-.1pt;\r\n margin-top:4.05pt;width:235.25pt;height:132.2pt;z-index:-1;visibility:visible;\r\n mso-wrap-style:square;mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;\r\n mso-wrap-distance-right:9pt;mso-wrap-distance-bottom:0;\r\n mso-position-horizontal:absolute;mso-position-horizontal-relative:text;\r\n mso-position-vertical:absolute;mso-position-vertical-relative:text''\r\n wrapcoords="0 0 0 21322 21485 21322 21485 0 0 0">\r\n <v:imagedata src="file:///C:\\Users\\ROHITK~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.jpg"\r\n  o:title="WhatsApp Image 2017-07-26 at 10.46.33 AM (2)"/>\r\n <w:wrap type="tight"/>\r\n</v:shape><![endif]-