(38, 1, 1, '1,2', 'Recruitment Partnership with UCCI - VTC', '<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-ansi-language:EN-IN">We are excited to announce the completion of initial\r\nbatch of UCCI - Vocational Training Center. You''ll find our students well\r\ntrained in GST accounting and office management. We are inviting your\r\nExpression of Interest in hiring from our students. Please find attached, a\r\nletter regarding recruitment partnership. &nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-ansi-language:EN-IN">&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-ansi-language:EN-IN">Kindly share with us your HR contact so that we can\r\nget in touch regarding possible placements at your organization.&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-ansi-language:EN-IN">&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-ansi-language:EN-IN">Best Regards,<o:p></o:p></span></p>\r\n\r\n<span lang="EN-IN" style="font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-ansi-language:EN-IN;mso-fareast-lang