(41, 1, 1, '1,2', 'Circular No.1/1/2017 dtd 26 June 2017', 'Kindly find attached Circular No.1/1/2017 dated 26 June 2017 of Central Board of Excise &amp; Customs, Ministry of Finance, Govt. of India, for your kind information.<div><br></div><div>Regards,</div><div><br></div><div>Anil Mishra</div><div>Hony. Secretary General</div><div>&nbsp;</div>', 'true', '2017-09-28 09:43:06'),
(42, 1, 1, '1,2', 'Cleanliness of Ayad River ', '<p class="MsoNormal">Kindly peruse\r\nthe attached letter of Commissioner, Nagar Nigam &amp; CEO, Smart City Project\r\nseeking support of UCCI for cleaning &amp; renovation/beautification of Ayar\r\nRiver.&nbsp; </p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">A massive\r\ncampaign for above work is scheduled on 2<sup>nd</sup> October, 2017 at &amp;\r\nfrom 8.00 a.m. Various organizations viz.&nbsp;\r\nR.K. Marble, Miraj Group, Secure Meters Ltd., RSMML, UCCI &amp; Udaipur\r\nCement Works, Mining Association, Hindustan Zinc, Sadbhav, Tata and others with\r\ncoutsey NHAI are involved in the campaign.</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Members are\r\nrequested to kindly consider facilitating &amp; supporting above noble campaign\r\nunder their CSR obliglations, being initiated by Nagar Nigam to make our City\r\nas Smart City in true sense.</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">As invited by\r\nNagar Nigam, we also request our members to kindly make it convenient to\r\nparticipate in above campaign to be inaugurated by Hon’ble Home Minister, Shri\r\nGulab Chand Kataria.</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">With regards,</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Hans Raj\r\nChoudhary</p>\r\n\r\n<p class="MsoNormal">President</p><p class="MsoNormal"><br></p>', 'true', '2017-09-29 11:25:14'),
(43, 1, 1, '1,2', 'Circular No.2/2/2017-GST dated 4th July 2017', 'Kindly find attached Circular No.2/2/2017-GST dated 4th July 2017 issued by GST Policy Wing of Central Board of Excise &amp; Customs, Govt. of India for your kind information.<div><br></div><div>Regards,</div><div><br></div><div>Anil Mishra</div><div>Hony. Secretary General</div><div>&nbsp;</div>', 'true', '2017-09-29 12:58:56'),
(44, 1, 1, '1,2', 'Samasya Samadhan Shivir on 11.10.2017 at 4 pm at UCCI', '<p style="margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">The 67<sup>th</sup>\r\nIndustrial Grievances Redressal Camp (Samasya Samadhan Shivir) will be held at\r\nUCCI on Wednesday, the 11<sup>th</sup>&nbsp;October, 2017.</span><span style="font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</span><span style="font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Members are\r\nrequested to kindly send us issues/problems connected with their\r\nindustries/businesses well in advance, so that they are sent to the concerned\r\ndepartments well in advance for effective deliberation in the Shivir and\r\nredressal.&nbsp;&nbsp;Members are also requested to kindly make it convenient\r\nto attend the Shivir by themselves and/or depute their official/s to participate\r\nin the Camp.</span><span style="font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</span><span style="font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">With regards,</span><span style="font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">&nbsp;</span><span style="font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Ashish Chhabra</span><span style="font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222"><o:p></o:p></span></p>\r\n\r\n<span style="font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Sr.\r\nVice President</span><div><span style="font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><br></span></div>', 'true', '2017-10-03 10:28:04'),
(45, 1, 1, '1,2', 'HR CONCLAVE 2017 ON TRANSFORMING HR ; “BECOMING A STRATEGIC BUSINESS PARTNER” –  OCTOBER 27, 2017', '<p class="MsoNormal">Kindly peruse the attached Invitation letter of Dean, School\r\nof Management, Sir Padampat Singhania University, Udaipur and the Broacher for\r\nthe captioned event being organized by Sir Padampat Singhania University in\r\nassociation with NIHRON and JK Cement Ltd. on 27<sup>th</sup> October, 2017 at\r\nSir Padampat Singhania University.</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Interested members may kindly like to participate in the\r\nConclave by sending a confirmatory email at <a href="mailto:sushil.alwani@spsu.ac.in">sushil.alwani@spsu.ac.in</a> or\r\nhrconcolave@spsu.ac.in</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">With regards,</p>\r\n\r\n<p class="MsoNormal"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class="MsoNormal">Anil Mishra</p>\r\n\r\n<span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:AR-SA;\r\nmso-bidi-language:AR-SA">Hony. Secretary General</span><div><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:AR-SA;\r\nmso-bidi-language:AR-SA"><br></span></div>', 'true', '2017-10-06 06:19:30'),
(46, 1, 1, '1,2', 'Application for Rajasthan State Export Award', '<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#212121">We have received an information regarding the Rajasthan State Export\r\nAwards for Export Excellence from Government of Rajasthan.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;">We are enclosing the copy of advertisement,\r\napplication form &amp; list of categories for the same.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;">If you 