nd-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><br></span></p>', 'true', '2017-10-06 06:44:02'),
(47, 1, 1, '1,2', 'Samasya Samadhan Shivir on 11.10.2017 at 4 pm at UCCI', '<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">As\r\nalready informed through circular No.UCCI/Program/Camp/2017-18/277 dtd. 3.10.2017, the 67<sup>th</sup> &nbsp;Samasya Samadhan\r\nShivir (Industrial Grievances Redressal Camp) is scheduled to be held at UCCI on\r\nWednesday, the 11<sup>th</sup> October, 2017 at 4.00 p.m. <o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">Members\r\nare requested to kindly send their industry-related pending issues/problems to\r\nus latest by 3.00 pm of 11.10.2017, so that they are included in the agenda\r\npoints of meeting for discussion and possible redressal. Members are also\r\nrequested to personally attend the Shivir or depute their authorized\r\nrepresentative for direct deliberation on the issue/s with the officials of the\r\nconcerned Government Departments.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">With\r\nkind regards,<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">Ashish Chhabra<o:p></o:p></span></b></p>\r\n\r\n<p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">Chairman, DLIAC Sub Committee &amp; Sr.\r\nVice President</span></b></p><p class="MsoNormal" style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><b><span style="font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;color:#212121">&nbsp;<o:p></o:p></span></b></p>', 'true', '2017-10-09 05:16:46'),
(48, 1, 4, '1,2', 'E - News Letter dated 9.10.2017', '<span style="font-family: LatoHairline;">We are pleased to forward in attachment our E - News Letter dated 9.10.2017, for favour of your kind perusal.</span><div><span style="font-family: LatoHairline;"><br></span></div><div><span style="font-family: LatoHairline;">With best regards,</span></div><div><span style="font-family: LatoHairline;"><br></span></div><div><span style="font-family: LatoHairline;">Anil Mishra</span></div><div><span style="font-family: LatoHairline;">Hony. Secretary General</span></div><div><span style="font-family: LatoHairline;"><br></span></div>', 'true', '2017-10-09 13:18:19'),
(49, 1, 1, '1,2', 'Labour Department Circular', 'Kindly find attached Circular No.F.1(8)(1)Bonus/Cir/03/15713 dated 3 \r\nOctober 2017 issued by Additional Labour Commissioner (I.R.), Rajasthan,\r\n Jaipur, for your kind information.<br><br>With best regards,<br><br>Anil Mishra<br>Hony. Secretary General<br><br><br>', 'true', '2017-10-10 08:03:20'),
(50, 1, 4, '1,2', 'Weekly News Letter dated 11 October 2017', '<p style="font-family: LatoHairline;">We are pleased to attach our E - News Letter dated 11 October 2017 for favour of your perusal.</p><div style="font-family: LatoHairline;"><br></div><div style="font-family: LatoHairline;">Regards,</div><div style="font-family: LatoHairline;"><br></div><div style="font-family: LatoHairline;">Anil Mishra</div><div style="font-family: LatoHairline;">Hony. Secretary General</div>', 'true', '2017-10-11 13:08:43'),
(51, 1, 4, '1,2', 'E - News letter on Deepawali Sneh Milan ', 'We are pleased to submit to our esteemed members that Deepawali Sneh Milan Samaroh was graciously organised at UCCI on 14.10.2017 and we take the liberty to submit before the glimpses of the Samaroh by way of attached E - News Letter for your kind perusal.<div><br></div><div>On this auspicious festival of lights,&nbsp;</div><div>May the Glow of Joy, Prosperity and Happiness&nbsp;</div><div>Illuminate your Life and your House.</div><div><br></div><div>Wishing you a Happy Deepawali.</div><div><br></div><div>Kind regards,</div><div><br></div><div>Hans Raj Choudhary</div><div><br></div><div><br></div><div><div><br></div><div><br><div><br></div><div><br></div></div></div>', 'true', '2017-10-17 13:07:12'),
(52, 1, 1, '1,2', 'ISSUES OF CONCERN/POINTS RELATING TO GST FOR DISCUSSION IN THE MEETING WITH CHIEF COMMISSIONER, GST ON 24.10.2017 AT 4.00 P.M.', '<p class="MsoNormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Dr.\r\nS.L. Meena, Chief Commissioner, GST, Department of Central Excise, Jaipur has\r\ndesired a meeting with President, UCCI to discuss and deliberate various issues\r\n&amp; problems relating to GST.&nbsp; The meeting is scheduled tomorrow on 24<sup>th</sup>\r\nOctober, 2017 at 4.00 p.m.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:3.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><o:p>&nbsp;</o:p></span><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;">Members\r\nare requested to send their issues of concern, problems and clarifications\r\nrequired on any points/provisions relating to GST, so as to reach us latest by\r\n12.00 noon of 24</span><sup style="font-family: &quot;Times New Roman&quot;, serif;">th</sup><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;"> October, 2017.&nbsp;</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:3.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><o:p>&nbsp;</o:p></span><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;">All\r\nthe received issues/problems shall be consolidated and raised in the above\r\nmeeting for clarification/possible redressal.</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:5.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><o:p>&nbsp;</o:p></span><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;">This\r\nmay kindly be treated as urgent &amp; important.</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:5.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><o:p>&nbsp;</o:p></span><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;">With\r\nregards,</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:6.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><o:p>&nbsp;</o:p></span><span style="font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;">Anil\r\nMishra</span></p>\r\n\r\n<p class="MsoNormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Hony.\r\nSecretary General</span></p><p class="MsoNormal"><span lang="EN-IN" style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">&nbsp;<o:p></o:p></span></p>', 'false', '2017-10-23 08:03:59');
