INSERT INTO `projects` (`id`, `description`, `created_on`, `created_by`) VALUES
(1, '<div><div><ul><li><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; font-weight: bold;">Environment Park IVth Phase Project at M.I.A.</span><br></li></ul></div><div><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;"><br></span></div><div><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;">Being conscious about pollution-free environmental aspects, UCCI has developed a beautiful landscape under its Environment Park Project on a land of approx. 1 lakh sq. ft., allotted to it by RIICO, behind Chamber Bhawan at Madri, Udaipur. The entire area of the park is covered with lawns and planted with different kind of ornamental plants and trees. With the development of Environment Park in Madri, the over-all area of Mewar Industrial Area at Madri has been beautified and taken an aesthetic view.</span><br></div></div><div><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;"><br></span></div><div><ul><li><span style="font-weight: bold;">SDC Project<br></span></li><li><span style="font-weight: bold;">Promotion of Rural Tourism<br></span></li><li><span style="font-weight: bold;">Human &amp; Institutional Development<br></span></li><li><span style="font-weight: bold;">Gainful Utilization of Marble Slurry<br></span></li><li><span style="font-weight: bold;">Recycling of water using Filter Press in Marble Industries<br></span></li><li><span style="font-weight: bold;">Entrepreneurship Development Project of KVIC.<br></span></li><li><span style="font-weight: bold;">Hazardous Waste Management Facility near village Gudli.</span><br></li></ul></div><div><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;"><br></span></div><div><span style="color: rgb(90, 90, 90); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;"><br></span></div>', '2017-08-14 10:54:22', 586);
